import React, { Component } from "react";
import { useEffect } from "react";
import axios from "axios";
import { Table } from "antd";

const RecipeListTable = () => {
  const [recipes, setRecipes] = React.useState([]);
  useEffect(() => {
    axios.get("/recipes").then((res) => {
      setRecipes(res.data);
    });
  }, []);
  const columns = [
    {
      title: "Title",
      dataIndex: "title",
      key: "title",
    },
    {
      title: "Rating",
      dataIndex: "rating",
      
    },
    {
      title: "Content",
      dataIndex: "content",
      
    },
    {
      title: "Action",
      dataIndex: "content",
      
    },
  ];
  return (
    <React.Fragment>
      <Table dataSource={recipes} columns={columns} />;
    </React.Fragment>
  );
};

export default RecipeListTable;
